import React from 'react';
import { Header } from '../components/header';
import { Container, TitleHighLight, TitlePrincipal } from './styles';

const Home = () => {
    return(
        <>
         <Header/>
         <Container>
            <div>
                <TitlePrincipal>
                    <TitleHighLight>
                        Implemente
                        <br/>
                    </TitleHighLight>
                    o seu futuro agora!
                </TitlePrincipal>
            </div>
            <div>
                <img style={{width: "420px"}} src="./logo.webp" alt="imagem da landing page"/>
            </div>

         </Container>
        </>
    )
}

export {Home}
